				   TrUserData).


d_msg_dtupdateresp(Bin, TrUserData) ->
    dfp_read_field_def_dtupdateresp(Bin, 0, 0,
				    id(undefined, TrUserData),
				    id(undefined, TrUserData),
				    id(undefined, TrUserData),
				    id([], TrUserData), id([], TrUserData),
				    id(undefined, TrUserData),
				    id([], TrUserData), TrUserData).

dfp_read_field_def_dtupdateresp(<<10, Rest/binary>>, Z1,
