    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_dtupdateresp(Rest2, 0, 0, F1, F2, F3,
				    cons(NewFValue, F4, TrUserData), F5, F6, F7,
				    TrUserData).


d_field_dtupdateresp_map_value(<<1:1, X:7,
				 Rest/binary>>,
