'd_enum_DtFetchResp.DataType'(2) -> 'SET';
'd_enum_DtFetchResp.DataType'(3) -> 'MAP';
'd_enum_DtFetchResp.DataType'(4) -> 'HLL';
'd_enum_DtFetchResp.DataType'(5) -> 'GSET';
'd_enum_DtFetchResp.DataType'(V) -> V.

